=====================================================

Skins  of mine and mates for Eve, Spark, BT20 some Howston and Lola T280

Setups of mine and mates mostly F3 but some BT20, F1 Howston and Lola as well 


Collection of Real Road for ISI and add-on tracks
=================================================

Good rubber for all tracks I use in my mods and others.

Realroad is custom name in caps.


Tracks
======
I added Joesville and Orchard Lake Ovals as people seem to have trouble finding them and I use in the Oval and Kart mods.


Packages
========

My current mods I use in ISI server  F3-ROOKIES 

Add packages,  mod manager will tell you what you need to online in my room.

It is less then 40 circuits including ISI content spread between all mods.

There is no rips / no permission tracks in my mods. 


Have fun in rFactor2 the best simulation out there for Historics.


